PBSuite

```json
{
  "application": "PBSuite",
  "version": "15.8.24",
  "environment": {
    "compiler": "intel-2017A",
    "python": "2.7.12"
  },
  "resources": {
    "cores": 20,
    "memory": "2700MB per core",
    "walltime": "24:00",
    "scheduler": "LSF (likely)"
  },
  "input": {
    "reference": "lambda.fasta",
    "reads": [
      "filtered_subreads.fastq",
      "filtered_subreads_2.fastq"
    ]
  },
  "output": {
    "directory": "pbjelly_out/"
  },
  "stages": [
    "setup",
    "mapping",
    "support",
    "extraction",
    "assembly",
    "output"
  ],
  "parameters": {
    "blasr": {
      "minMatch": 8,
      "sdpTupleSize": 8,
      "minPctSimilarity": 75,
      "bestn": 1,
      "nCandidates": 10,
      "maxScore": -500,
      "nproc": 20,
      "noSplitSubreads": true
    },
    "cluster": {
      "command": "echo '\${CMD}' | bsub -J \${JOBNAME} -W 24:00 -o \${STDOUT} -e \${STDERR} -n 20 -L /bin/bash -M 2700 -R span[ptile=20]",
      "nJobs": 4
    }
  }
}
```
